package db.domain;import java.util.Arrays;public class UserMissionImpl implements UserMission , 
				MissionData
			{	@Key	private String uname;	@Key	private int missionId;	private int dieCount;	private int nodeIndex;	private int createDate;	public UserMissionImpl() {	}	public UserMissionImpl(UserMission c) {		this.uname = c.getUname();		this.missionId = c.getMissionId();		this.dieCount = c.getDieCount();		this.nodeIndex = c.getNodeIndex();		this.createDate = c.getCreateDate();	}	@Override	public String tableName() {		return "user_mission";	}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setMissionId(int missionId) {		this.missionId = missionId;	}	public int getMissionId() {		return this.missionId;	}public void addMissionId(int missionId) {		this.missionId += missionId;}	public void setDieCount(int dieCount) {		this.dieCount = dieCount;	}	public int getDieCount() {		return this.dieCount;	}public void addDieCount(int dieCount) {		this.dieCount += dieCount;}	public void setNodeIndex(int nodeIndex) {		this.nodeIndex = nodeIndex;	}	public int getNodeIndex() {		return this.nodeIndex;	}public void addNodeIndex(int nodeIndex) {		this.nodeIndex += nodeIndex;}	public void setCreateDate(int createDate) {		this.createDate = createDate;	}	public int getCreateDate() {		return this.createDate;	}public void addCreateDate(int createDate) {		this.createDate += createDate;}}